import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";
// import Skills from './skills';

class Resume extends Component {
  render() {
    return (
      <div>
        <Grid>
          <Cell className="resume" col={12}>
            <div style={{ textAlign: "center" }}>
              <img
                src="./me.jpg"
                style={{ height: "300px", paddingtop: "5em" }}
                alt=""
                className="avatar-img"
              />
            </div>

            <p>
            Front end developer who is comfortable with JavaScript,HTML/CSS to deliver exceptional customer experiences. Experience with all aspects of product delivery, including gathering requirements, designing solutions and leading implementation teams.
Focused on being a valuable part of any team I am and believe in the team rising together and co-create software solutions.
            </p>

            https://www.linkedin.com/in/murial-anindo/
          </Cell>
        </Grid>
      </div>
    );
  }
}

export default Resume;
